  \"2013-03-15T21:30:45.720378\",\n\t\"name\": \"statewide-datasets-for-idaho-streamstats\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of a workspace (folder)
  containing four gridded datasets and a personal geodatabase. The gridded datasets
  are a grid of mean annual precipitation, a grid of forest land cover, and region
  grids used in the Idaho StreamStats application. One region grid is for peak flow
  estimates, the other is for low flows, mean annual flows, and monthly flow statistics.
  The personal geodatabase contains a polygon feature class of exclusion polygons,
  which identify areas in which use the StreamStats application is restricted.\",\n\t\"license_title\":
